import React from "react";
import styles from './ProjectSlider.module.css'

export default function ProjectBox(props){

    const style1 = styles["carousel-item"] + " bg-white rounded-3xl shadow-2xl";
    const style2 =  styles["custom_font"] + " text-left font-bold";
    const style3 = styles["custom_font"] + " text-gray-400 text-[15px]";
    const style4 = styles["custom_font"] + " text-[15px]";

    return <a className={style1} href="#">

    <div className="leading-loose">

        <div class="img-area">
            <img src={props.img} className="w-[300px] h-[175px] rounded-xl" alt=""/>
            <p class={style2}>{props.title}</p>
        </div>
        
        <div class="flex items-center justify-between">
            <p class={style3}>{props.name}</p>
            <div class="flex items-center">
                <i class="fa-regular fa-star fa-xs">&nbsp;&nbsp;</i>
                <p class={style4}>{props.rating}</p>
            </div>
        </div>

    </div>

</a>;

}
